import React from 'react';
import ReactDOM from 'react-dom/client';
import { useForm } from 'react-hook-form';


 const EmployeeForm = () => {
     /*empEntry = {
         empName : String,
         emailId : String,
         dob : Date,
         joinDate : Date
     };*/
     const { empEntry, handleSubmit } = useForm({
             shouldUseNativeValidation : true
     }
     );

     /*useEffect(() => {
     reset({
         empName : "",
         emailId : "",
         dob : "//",
         joinDate : "//"61
     });
     }, {});*/
     const handleEntry = (data) => console.log(data);
    // const handleError = (errors) => {};

     const errorMsg = {
         empName : { required : "Employee Name is required"},
         emailId : { required : "Email Id is required"},
         dob : { required : "Date of Birth is mandatory"},
         joinDate : { required : "Joining Date is mandatory"}
     };

     return(
        <form onSubmit={handleSubmit(handleEntry/*, handleError*/)}>
         <div>
         <label>Employee Name</label><br/>
         <input name="empName" type="text" {...empEntry("empName")} />

         </div>
         <hr/>
         <div>
                 <label>Employee EmailId</label><br/>
         <input name="emailId" type="text" {...empEntry}/>

         </div>
         <hr/>
         <div>
                 <label>Employee Date Of Birth</label><br/>
                   <input name="dob" type="date" {...empEntry}/>

         </div>
         <hr/>
         <div>
             <label>Employee Joining Date</label><br/>
             <input name="joinDate" type="date" {...empEntry}/>

         </div>
         <hr/>
         <button type="submit">Submit</button>
        </form>

     );
 }

const root = ReactDOM.createRoot(document.getElementById("root"));
